import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import { motion } from 'framer-motion';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import './Home.css'; // Assure-toi de styliser via ce fichier

const Home = () => {
    return (
        <div className="home">

            {/* MENU FIXE */}
            <header className="menu">
                <nav>
                    <div className="logo">RÉNOV+</div>
                    <ul>
                        <li><a href="#hero">Accueil</a></li>
                        <li><a href="#realisations">Réalisations</a></li>
                        <li><a href="#services">Services</a></li>
                        <li><a href="#contact">Contact</a></li>
                    </ul>
                </nav>
            </header>

            {/* SECTION HERO */}
            <motion.section
                id="hero"
                className="hero-section"
                initial={{ opacity: 0, y: -50 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 1 }}
            >
                <div className="hero-overlay" />
                <div className="hero-content">
                    <h1>Experts en Rénovation</h1>
                    <p>Donnez vie à vos espaces avec élégance et précision</p>
                    <button>Nos services</button>
                </div>
            </motion.section>

            {/* CAROUSEL */}
            <motion.section
                id="realisations"
                className="carousel-section"
                initial={{ opacity: 0 }}
                whileInView={{ opacity: 1 }}
                transition={{ duration: 1.2 }}
            >
                <h2>Nos Réalisations</h2>
                <Carousel autoPlay infiniteLoop showThumbs={false} showStatus={false}>
                    <div>
                        <img src="https://via.placeholder.com/800x400" alt="Projet 1" />
                        <p className="legend">Salle de bain moderne</p>
                    </div>
                    <div>
                        <img src="https://via.placeholder.com/800x400" alt="Projet 2" />
                        <p className="legend">Cuisine rénovée</p>
                    </div>
                </Carousel>
            </motion.section>

            {/* SERVICES */}
            <motion.section
                id="services"
                className="services-section"
                initial={{ opacity: 0 }}
                whileInView={{ opacity: 1 }}
                transition={{ duration: 1.2 }}
            >
                <h2>Nos Services</h2>
                <div className="services-list">
                    <div className="card">Rénovation intérieure</div>
                    <div className="card">Rénovation de cuisine</div>
                    <div className="card">Revêtements muraux</div>
                </div>
            </motion.section>

            {/* CONTACT */}
            <motion.section
                id="contact"
                className="contact-section"
                initial={{ opacity: 0 }}
                whileInView={{ opacity: 1 }}
                transition={{ duration: 1.2 }}
            >
                <h2>Contactez-nous</h2>
                <p>Email : contact@renovplus.fr</p>
                <p>Téléphone : 01 23 45 67 89</p>
            </motion.section>

        </div>
    );
};

export default Home;
